import React from "react";
import { withFirebaseHOC } from '../firebase'
import L from 'leaflet'
import { Map, TileLayer, Marker, Popup } from 'react-leaflet'

var myIcon = L.icon({
  iconUrl: 'data:image/png;base64,',
  iconSize: [25, 41],
  iconAnchor: [12.5, 41],
  popupAnchor: [0, -41]
})

class About extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        latlng: {
          lat: 19.076,
          lng: 72.877,
        },
        zoom: 13,
        type: "",
        name: "",
        email: "",
        phone: "",
        password: "",
        hasLocation: false
    }
    this.onChange = this.onChange.bind(this)
    this.handleSubmit = this.handleSubmit.bind(this)
  }

  onChange(e) {
      const { name, value } = e.target
      this.setState({
          [name]: value
      });
  }

  handleSubmit(e) {
      e.preventDefault()

  }



  componentDidMount() {

  }

  render() {
    const marker = this.state.hasLocation ? (
      <Marker position={this.state.latlng} icon={myIcon}>
        <Popup>
          <h2>You are here</h2>
        </Popup>
      </Marker>
    ) : null
    return (
      <div className="add-value">
          <h2>Choose</h2>
          <form onSubmit={this.handleSubmit} id="choose-form">
              <div id="kylo">
              <div className="form-group">
                <input type="number" id="edibleTime" name="edibleTime" className="form-control" onChange={this.onChange} value={this.state.name} autoComplete="off" placeholder="Time till the food becomes stale in hours" required />
              </div>
              <div className="form-group">
                <input type="number" id="feedPeople" name="feedPeople" className="form-control" onChange={this.onChange} value={this.state.email} autoComplete="off" placeholder="The number of people that can be fed" required />
              </div>
              <div className="form-group">
                <input type="text" id="foodType" className="form-control" name="foodType" onChange={this.onChange} value={this.state.phone} autoComplete="off" placeholder="Type of Food" required />
              </div>
              </div>
              <button className="btn btn-primary" type="submit" name="action">Submit</button>
          </form>
      </div>
    )
  }
}

export default withFirebaseHOC(About)
